// Update updates User fields by primary key
func (o *User) Update(db *gorm.DB, fields ...userDBSchemaField) error {
	dbNameToFieldName := map[string]interface{}{
		"id":                     o.ID,
		"created_at":             o.CreatedAt,
		"updated_at":             o.UpdatedAt,
		"deleted_at":             o.DeletedAt,
		"balance_usd":            o.BalanceUSD,
		"balance_btc":            o.BalanceBTC,
		"deposit_usd":            o.DepositUSD,
		"deposit_btc":            o.DepositBTC,
		"reinvest_usd":           o.ReinvestUSD,
		"reinvest_btc":           o.ReinvestBTC,
		"earn_usd":               o.EarnUSD,
		"earn_btc":               o.EarnBTC,
		"earn_with_partners_usd": o.EarnWithPartnersUSD,
		"earn_with_partners_btc": o.EarnWithPartnersBTC,
		"lang":            o.Lang,
		"ref1":            o.Ref1,
		"ref2":            o.Ref2,
		"ref3":            o.Ref3,
		"ref4":            o.Ref4,
		"ref5":            o.Ref5,
		"deposit_wallet":  o.DepositWallet,
		"withdraw_wallet": o.WithdrawWallet,
		"paid":            o.Paid,
		"last_received_profit_at": o.LastReceivedProfitAt,
		"role": o.Role,
		"name": o.Name,
	}
	u := map[string]interface{}{}
	for _, f := range fields {
		fs := f.String()
		u[fs] = dbNameToFieldName[fs]
	}
	if err := db.Model(o).Updates(u).Error; err != nil {
		if err == gorm.ErrRecordNotFound {
			return err
		}

		return fmt.Errorf("can't update User %v fields %v: %s",
			o, fields, err)
	}

	return nil
}

